webpackJsonp([87010108657977],{3415:function(a,t){a.exports={data:{markdownRemark:{html:'<p><strong>🌡24℃ ☁</strong></p>\n<p>今日は子供会主催の廃品回収ボランティアに参加しました。\n<a href="../05/20-diary.md">半年ぶりくらい</a>でしょうか。</p>\n<p>重い古新聞や古雑誌、広告紙、さらに瓶や缶など大量の廃品をトラックに積み込むお手伝いです。\n軍手はしていたのですが、やはり手が痛くなり、そしてとても疲れました。\n今回の報酬はアイスでした。</p>\n<p>午後は遊びに来た S 君とファミコンで遊びました。\nさらに H 君が遊びに来たので、<a href="../09/24-diary.md">先日のマッピング</a>で見つけた、西坂戸の公園へ遊びに行きました。</p>',frontmatter:{cover:null,date:"1990-10-14T21:00:00+09:00",strDate:"1990/10/14",title:"日記"}}},pathContext:{path:"/ja/blog/1990/10/14-diary/",langKey:"ja"}}}});
